```javascript
// دالة لتسجيل الرسائل في السجل
function log(message) {
    const timestamp = new Date().toISOString(); // الحصول على الوقت الحالي
    const logMessage = `${timestamp} - ${message}`; // إنشاء الرسالة المدمجة بالوقت
    console.log(logMessage); // طباعة الرسالة في سجلات المتصفح
}

// استخدام الدالة لتسجيل رسائل مختلفة
log("تم بدء البرنامج");
log("تم تحديث البيانات");
log("تم إغلاق البرنامج");

// يمكنك إضافة المزيد من الرسائل هنا
```

هذا البرنامج البسيط يحتوي على دالة `log` تقوم بتسجيل الرسائل مع الوقت الحالي. يمكنك استخدام هذه الدالة في أي جزء من برنامجك لتسجيل الأحداث الهامة.

إذا كنت ترغب في استخدام هذا في بيئة غير متصفح (مثل Node.js)، يمكنك استخدام `console.log` بنفس الطريقة، ولكن قد تحتاج إلى استخدام أدوات أخرى لتسجيل السجلات في بيئة خادم.

